import React from 'react';
import './App.css';

class App extends React.Component {

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <p>
            Hello, welcome to PawsUp!
          </p>
        </header>
      </div>
    );
  }
}

export default App;
